import cProfile
from math import sqrt


def task_1_1(num):
    num_rev = ''
    for i in range(len(num)):
        num_rev += num[len(num) - i - 1]

    print(num_rev)

# O(n)

def task_1_2(num):
    num_rev = num[::-1]

    print(num_rev)

# O(n)

num = input('Введите длинное число: ')
cProfile.run('task_1_1(num), task_1_2(num)')

